#Colors
.eqv WHITE	0x000000
.eqv BLACK	0xffffff
.eqv RED	0xff0000
.eqv YELLOW	0xffff00
.eqv BLUE	0x0000ff
	
Grid : .word WHITE, WHITE, WHITE, WHITE,
	WHITE, WHITE, WHITE, WHITE,
	WHITE, WHITE, WHITE, WHITE,
	WHITE, WHITE, WHITE, WHITE
	
Scores : .word 0, 0

.eqv GP 	0x10008000
	

.text

.globl main

main :

#---------------------------------------------------------------------
#--------------------INTRO PIC DRAWER---------------------------------
#---------------------------------------------------------------------

	la $t1, MenuPic
	li $t2, GP
	
	MenuLoop :
		beq $s0, 16384, StartingInput
		lw $t0, 0($t1)
		sw $t0, 0($t2)
		addi $t1, $t1, 4
		addi $t2, $t2, 4
		addi $s0, $s0, 1
		j MenuLoop

######################################################################

#---------------------------------------------------------------------
#---------------------------INPUT-------------------------------------
#---------------------------------------------------------------------	

	StartingInput :

		li 	  $t0, 	0xffff0000
		li 	  $t1, 	0xffff0004

		read_starting_input_loop:

			lw    $t2,  0($t0)
			andi  $t2,  $t2,  1
			beqz  $t2,  read_starting_input_loop
			
	jal WhiteBg
	jal DrawLetters
	jal DrawScoreLeft
	jal DrawScoreRight
	jal DrawGrid
	jal DrawSkeleton
	
	li $s0, 0
	jal ChoosePlayer

#-----------------------------------------------------------------------	
	
	read_input:
	
		li 	  $t0, 	0xffff0000
		li 	  $t1, 	0xffff0004
		li $t3, 0
		sw $t3, 0($t1)
	
		read_input_loop:

			lw    $t2, 0($t0)      # Read Receiver Control register
			andi  $t2, $t2, 1	# Mask out Ready bit
			beqz  $t2, read_input_loop
			lw    $t3, 0($t1)
			

   	beq   $t3, 102,  Finput
	beq   $t3, 103,  Ginput
	beq   $t3, 104,  Hinput
	beq   $t3, 106,  Jinput
	
	j read_input
		
		
	Finput :
		li $a0, 0
		j Display
		
		
		
	Ginput :
		li $a0, 4
		j Display
		
		
		
	Hinput :
		li $a0, 8
		j Display
		
		
	
	Jinput :
		li $a0, 12
		j Display
			
########################################################################################

		
#----------------------------------------------------------------------------------
#--------------------------------DISPLAY-------------------------------------------
#-----------display calls all the functions related to displaying------------------
# Order of display :
# 1- White background (to "erase" everything)
# 2- Scores and Grid (colored squares)
# 3- Falling Squares (if any)
# 4- Skeleton
# In this order, we're drawing skeleton over squares to overwrite them instead of
# calculating the size of the squares while taking consideration of the borders
#----------------------------------------------------------------------------------				
	
	Display :
		
		jal SquareFall
	
		jal RefreshGrid
		jal DrawScoreLeft
		jal DrawScoreRight
		jal DrawGrid
		jal DrawSkeleton
		
		jal CheckScores
		jal CheckWinner
		
		jal ChoosePlayer
		jal RefreshGrid
		jal DrawScoreLeft
		jal DrawScoreRight
		jal DrawGrid
		jal DrawSkeleton
		
		j read_input
	
#####################################################################################################	
	
	WhiteBg :
		addi $sp, $sp, -12
		sw $t0, 0($sp)
		sw $t1, 4($sp)
		sw $t2, 8($sp)
		
		li $t0, 0
		li $t1, GP
		li $t2, WHITE
		
		WhiteBgLoop :
			beq $t0, 16384, exit
			sw $t2, 0($t1)
			addi $t1, $t1, 4
			addi $t0, $t0, 1
			j WhiteBgLoop
		exit :
			jr $ra

#######################################################################################
#--------------------------------------------------------------------------------------
#-----------------------------------REFRESHERS-----------------------------------------
#--------------------------------------------------------------------------------------

	RefreshGrid :
		addi $sp, $sp, -20
		sw $t0, 0($sp)
		sw $t1, 4($sp)
		sw $t2, 8($sp)
		sw $t3, 12($sp)
		sw $ra, 16($sp)
		
		li $t0, 0
		li $t2, 17028
		add $t2, $gp, $t2
		li $t3, WHITE
		
		RefreshGridLoop0 :
			beq $t0, 78, exitRefreshGridLoop0
			li $t1, 0
			
			RefreshGridLoop1 :
				beq $t1, 63, exitRefreshGridLoop1
				sw $t3, 0($t2)
				addi $t2, $t2, 4
				addi $t1, $t1, 1
				j RefreshGridLoop1
				
			exitRefreshGridLoop1 :
			addi $t2, $t2, 260
			addi $t0, $t0, 1
			j RefreshGridLoop0
			
		exitRefreshGridLoop0 :
		
		addi $t2, $gp, 16580
		li $t1, WHITE
		li $t0, 0
		
		RefreshBetweenScoresLoop:
			beq $t0, 15, exitRefreshBetweenScoresLoop
			sw $t1, 0($t2)
			sw $t1, 64($t2)
			addi $t2, $t2, 4
			addi $t0, $t0, 1
			j RefreshBetweenScoresLoop
			
		exitRefreshBetweenScoresLoop :
		
		lw $t0, 0($sp)
		lw $t1, 4($sp)
		lw $t2, 8($sp)
		lw $t3, 12($sp)
		lw $ra, 16($sp)
		addi $sp, $sp, 20
		
		jr $ra




#######################################################################################

#-------------------------------------------------------------------
#----------------------------SCORE DRAWERS--------------------------
#-------------------------------------------------------------------
	
	DrawScore :	#$a0 as starting index
		addi $sp, $sp, -20
		sw $a0, 0($sp)
		sw $t0, 4($sp)
		sw $t1, 8($sp)
		sw $t2, 12($sp)
		sw $ra, 16($sp)
		
		li $t0, 0
		li $t2, BLUE
		
		DrawScoreLoop0 :
			beq $t0, 8, exitDrawScoreLoop0
			li $t1, 0
			
			DrawScoreLoop1 :
				beq $t1, 8 exitDrawScoreLoop1
				
				sw $t2, 0($a0)
				addi $a0, $a0, 4
				addi $t1, $t1, 1
				j DrawScoreLoop1
			
			exitDrawScoreLoop1:
			addi $t0, $t0, 1
			addi $a0, $a0, 480
			j DrawScoreLoop0
		
		exitDrawScoreLoop0 :
		lw $a0, 0($sp)
		lw $t0, 4($sp)
		lw $t1, 8($sp)
		lw $t2, 12($sp)
		lw $ra, 16($sp)
		addi $sp, $sp, 20
		jr $ra
		
		
		
		
	DrawScoreLeft :		#checks how many 
		addi $sp, $sp, -8
		sw $a0, 0($sp)
		sw $ra, 4($sp)
		
		la $t0, Scores
		lw $t0, 0($t0)
		li $a0, 12384
		add $a0, $gp, $a0		#adress of the start of the score
		li $t1, 0
		
		DrawScoreLeftLoop :
			beq $t1, $t0, exitDrawScoreLeftLoop
			
			jal DrawScore
			addi $t1, $t1, 1
			addi $a0, $a0, 32
			j DrawScoreLeftLoop
			
		exitDrawScoreLeftLoop :
		lw $a0, 0($sp)
		lw $ra, 4($sp)
		addi $sp, $sp, 8
		jr $ra		
			
			
	DrawScoreRight :
		addi $sp, $sp, -8
		sw $a0, 0($sp)
		sw $ra, 4($sp)
		
		la $t0, Scores
		lw $t0, 4($t0)
		li $a0, 12672
		addi $a0, $a0, GP
		li $t1, 0
		
		DrawScoreRightLoop :
			beq $t1, $t0, exitDrawScoreRightLoop
			
			jal DrawScore
			addi $t1, $t1, 1
			addi $a0, $a0, -32
			j DrawScoreRightLoop
		
		exitDrawScoreRightLoop :
		lw $a0, 0($sp)
		lw $ra, 4($sp)
		addi $sp, $sp, 8
		jr $ra


##################################################################


#-----------------------------------------------------------------
#-------------------SQUARE/GRID DRAWERS---------------------------
#-----------------------------------------------------------------

	DrawSquare :
	#Takes as parameters $a0 as starting index, $a1 as color
	addi $sp, $sp, -16
	sw $a0, 0($sp)
	sw $t0, 4($sp)
	sw $t1, 8($sp)
	sw $ra, 12 ($sp)
	
	li $t0, 0
	
	DrawSquareLoop0 :
		beq $t0, 16, exitDrawSquareLoop0
		li $t1, 0
		DrawSquareLoop1 :
			beq $t1, 15, exitDrawSquareLoop1
			sw $a1, 4($a0)
			addi $a0, $a0, 4
			addi $t1, $t1, 1
			j DrawSquareLoop1
		exitDrawSquareLoop1 :
		addi $a0, $a0, 452
		addi $t0, $t0, 1
		j DrawSquareLoop0
	exitDrawSquareLoop0:
	
	lw $a0, 0($sp)
	lw $t0, 4($sp)
	lw $t1, 8($sp)
	lw $ra, 12($sp)
	addi $sp, $sp, 16
	
	jr $ra
	
	
	DrawGrid :
	addi $sp, $sp, -24
	sw $a0, 0($sp)
	sw $a1, 4($sp)
	sw $t0, 8($sp)
	sw $t1, 12($sp)
	sw $s0, 16($sp)
	sw $ra, 20($sp)
	
	la $s0, Grid
	li $a0, 24704
	add $a0, $gp, $a0
	li $t0, 0
	
	DrawGridLoop0 :
		beq $t0, 4, exitDrawGridLoop0
		li $t1, 0
		DrawGridLoop1 :
			beq $t1, 4, exitDrawGridLoop1
			lw $a1, 0($s0)		#Loading the color from the grid
			jal DrawSquare		#square at $a0 has color $a1
			addi $s0, $s0, 4
			addi $a0, $a0, 64
			addi $t1, $t1, 1
			j DrawGridLoop1
		exitDrawGridLoop1 :
		addi $a0, $a0, 7936
		addi $t0, $t0, 1
		j DrawGridLoop0
	exitDrawGridLoop0 :
	
	lw $a0, 0($sp)
	lw $a1, 4($sp)
	lw $t0, 8($sp)
	lw $t1, 12($sp)
	lw $s0, 16($sp)
	lw $ra, 20($sp)
	addi $sp, $sp, 24
	
	jr $ra
	
################################################################################
			
#-------------------------------------------------------------------------------
#-----------------------------SKELETON DRAWER-----------------------------------
#-------------------------------------------------------------------------------

	DrawSkeleton :
	
	addi $sp, $sp -16
	sw $a0, 0($sp)
	sw $t0, 4($sp)
	sw $t1, 8($sp)
	sw $ra, 12($sp)
	
	li $a0, 24704
	add $a0, $gp, $a0
	li $t0, 0
	
	HorizontalGridLoop :
		beq $t0, 5, exitHorizontalGridLoop
		jal DrawHorizontalLine
		addi $a0, $a0, 8192
		addi $t0, $t0, 1
		j HorizontalGridLoop
	
	exitHorizontalGridLoop :
	li $a0, 24704
	add $a0, $gp, $a0
	li $t0, 0
	
	VerticalGridLoop :
		beq $t0, 5, exitVerticalGridLoop
		jal DrawVerticalLine
		addi $a0, $a0, 64
		addi $t0, $t0, 1
		j VerticalGridLoop
	
	exitVerticalGridLoop :
	li $a0, 12384
	add $a0, $gp, $a0
	li $t0, 0
	
	HorizontalScoreLoop0 :
		beq $t0, 2, exitHorizontalScoreLoop0
		li $t1, 0
		
		HorizontalScoreLoop1 :
			beq $t1, 2, exitHorizontalScoreLoop1
			jal DrawHorizontalScoreLine
			addi $a0, $a0, 224
			addi $t1, $t1, 1
			j HorizontalScoreLoop1
		
		exitHorizontalScoreLoop1 :
