	SquareFall :
	addi $sp, $sp, -32
	sw $t0, 0($sp)
	sw $t1, 4($sp)
	sw $t2, 8($sp)
	sw $s0, 12($sp)
	sw $a0, 16($sp)
	sw $a1, 20($sp)
	sw $v0, 24($sp)
	sw $ra, 28($sp)
	
	li $t0, 0
	la $t1, Grid
	add $t1, $t1, $a0
	
	TimesCheckLoop :
		beq $t0, 4, exitTimesCheckLoop
		lw $t2, 0($t1)
		bne $t2, WHITE, exitTimesCheckLoop
		addi $t0, $t0, 1
		addi $t1, $t1, 16
		j TimesCheckLoop
		
	exitTimesCheckLoop :
	bne $t0, 0 proceedSquareFall	#if the grid is full, input again in another grid
	jal DrawInvalidRectangle	#display invalidity
	
	lw $t0, 0($sp)
	lw $t1, 4($sp)
	lw $t2, 8($sp)
	lw $s0, 12($sp)
	lw $a0, 16($sp)
	lw $a1, 20($sp)
	lw $v0, 24($sp)
	lw $ra, 28($sp)
	addi $sp, $sp, 32
	
	jr $ra
	
	
	proceedSquareFall :
	jal ChooseColor
	move $a1, $v0
	move $s0, $t0
	
	sll $a0, $a0, 4
	addi $a0, $a0, 16512
	add $a0, $gp, $a0
	li $t0, 0
	
	SquareFallLoop0 :
		beq $t0, $s0, exitSquareFallLoop0
		li $t1, 0
		
		SquareFallLoop1 :
			beq $t1, 16, exitSquareFallLoop1
			
			jal RefreshGrid
			jal DrawGrid
			jal DrawSquare
			jal DrawSkeleton
			
			addi $a0, $a0, 512
			addi $t1, $t1, 1
			
			#DELAY TIME?????????????????
			
			j SquareFallLoop1
			
		exitSquareFallLoop1 :
		addi $t0, $t0, 1
		j SquareFallLoop0
		
	exitSquareFallLoop0 :
	
	lw $t0, 0($sp)
	lw $t1, 4($sp)
	lw $t2, 8($sp)
	lw $s0, 12($sp)
	lw $a0, 16($sp)
	
	jal AddToGrid
	
	addi $s0, $s0, 1
	
	lw $a1, 20($sp)
	lw $v0, 24($sp)
	lw $ra, 28($sp)
	addi $sp, $sp, 32	
	
	jr $ra
	
