	CheckScores :
	addi $sp, $sp, -36
	sw $s0, 0($sp)
	sw $t1, 4($sp)
	sw $a0, 8($sp)
	sw $a1, 12($sp)
	sw $a2, 16($sp)
	sw $a3, 20($sp)
	sw $v0, 24($sp)
	sw $ra, 28($sp)
	
	la $s0, Grid
	li $t0, 0
	
	CheckScoresHorizontalLoop0 :
		beq $t0, 4, exitCheckScoresHorizontalLoop0 
		li $t1, 0
		
		CheckScoresHorizontalLoop1 :
			beq $t1, 2, exitCheckScoresHorizontalLoop1
			lw $a0, 0($s0)
			lw $a1, 4($s0)
			lw $a2, 8($s0)
			jal EqualColors
			beq $v0, 1, UpdateScores
			addi $s0, $s0, 4
			addi $t1, $t1, 1
			j CheckScoresHorizontalLoop1
			
		exitCheckScoresHorizontalLoop1 :
		addi $s0, $s0, 8
		addi $t0, $t0, 1
		j CheckScoresHorizontalLoop0
		
	exitCheckScoresHorizontalLoop0 :
	
	la $s0, Grid
	li $t0, 0
	
	CheckScoresVerticalLoop :
		beq $t0, 8, exitCheckScoresVerticalLoop 
		lw $a0, 0($s0)
		lw $a1, 16($s0)
		lw $a2, 32($s0)
		jal EqualColors
		beq $v0, 1, UpdateScores
		addi $s0, $s0, 4
		addi $t0, $t0, 1
		j CheckScoresVerticalLoop 
		
	exitCheckScoresVerticalLoop :
	
	la $s0, Grid
	li $t0, 0
	
	CheckScoresDiagonalLoop0 :
		beq $t0, 2, exitCheckScoresDiagonalLoop0
		li $t1, 0
		
		CheckScoresDiagonalLoop1 :
			beq $t1, 2, exitCheckScoresDiagonalLoop1
			lw $a0, 0($s0)
			lw $a1, 20($s0)
			lw $a2, 40($s0)
			jal EqualColors
			beq $v0, 1, UpdateScores
			lw $a0, 8($s0)
			lw $a1, 20($s0)
			lw $a2, 32($s0)
			jal EqualColors
			beq $v0, 1, UpdateScores
			addi $s0, $s0, 4
			addi $t1, $t1, 1
			j CheckScoresDiagonalLoop1
			
		exitCheckScoresDiagonalLoop1 :
		addi $s0, $s0, 8
		addi $t0, $t0, 1
		j CheckScoresDiagonalLoop0
		
	exitCheckScoresDiagonalLoop0 :
	
	lw $s0, 0($sp)
	lw $t1, 4($sp)
	lw $a0, 8($sp)
	lw $a1, 12($sp)
	lw $a2, 16($sp)
	lw $a3, 20($sp)
	lw $v0, 24($sp)
	lw $ra, 28($sp)
	addi $sp, $sp, 32
	
	jr $ra
	
	UpdateScores :
	
	lw $s0, 0($sp)
	not $s0, $s0
	andi $s0, $s0, 1
	sll $s0, $s0, 2
	la $t0, Scores
	add $t0, $t0, $s0
	lw $s0, 0($t0)
	addi $s0, $s0, 1
	sw $s0, 0($t0)
	
	la $s0, Grid
	li $t0, 0
	li $t1, WHITE
	
	UpdateScoresLoop :
		beq $t0, 16, exitUpdateScoresLoop
		sw $t1, 0($s0)
		addi $s0, $s0, 4
		addi $t0, $t0, 1
		j UpdateScoresLoop
		
	exitUpdateScoresLoop :
	
	jal DrawScoreLeft
	jal DrawScoreRight
	
	li $a0, 64
	li $a1, 2000
	li $a2, 0
	li $a3, 127
	li $v0, 33
	syscall
	li $a0, 67
	syscall
	li $a0, 72
	syscall
	
	lw $s0, 0($sp)
	lw $t1, 4($sp)
	lw $a0, 8($sp)
	lw $a1, 12($sp)
	lw $a2, 16($sp)
	lw $a3, 20($sp)
	lw $v0, 24($sp)
	lw $ra, 28($sp)
	addi $sp, $sp, 32
	
