	EqualColors :
		addi $sp, $sp, -16
		sw $a0, 0($sp)
		sw $a1, 4($sp)
		sw $a2, 8($sp)
		sw $ra, 12($sp)
		
		seq $a0, $a0, $a1
		seq $a1, $a1, $a2
		sne $a2, $a2, WHITE
		
		and $v0, $a0, $a1
		and $v0, $v0, $a2
		
		lw $a0, 0($sp)
		lw $a1, 4($sp)
		lw $a2, 8($sp)
		lw $ra, 12($sp)
		addi $sp, $sp, 16
		jr $ra
		
